_üõ†Ô∏è Refactor suggestion_

**Fix mock restoration: don‚Äôt create a new spy in afterAll; restore the original spy instead.**

Currently afterAll creates a new spy and restores that, leaving the original spy active and potentially polluting other tests.


Apply:

```diff
-describe('Query Index', () => {
-  beforeAll(() => {
-    jest.spyOn(console, 'log').mockImplementation(jest.fn());
-  });
+describe('Query Index', () => {
+  let logSpy: jest.SpyInstance;
+  beforeAll(() => {
+    logSpy = jest.spyOn(console, 'log').mockImplementation(jest.fn());
+  });

-  afterAll(() => {
-    jest.spyOn(console, 'log').mockRestore();
-  });
+  afterAll(() => {
+    logSpy.mockRestore();
+  });
```

Alternative: replace afterAll body with `jest.restoreAllMocks()` if your Jest config enables restoring mocks between tests.

