## Problem
Import statements are inconsistently organized, violating the project's coding standards for import grouping.

## Files Affected
- `src/App.tsx` (lines 1-15) - Mixed import grouping
- Multiple components throughout codebase

## Current Code
```typescript
// Inconsistent grouping
import { useState, useEffect } from 'react';
import './App.css';
import { createClient } from '@supabase/supabase-js';
import GameSetup from './components/GameSetup';
```

## Expected Code
```typescript
// Group: External libraries, then local modules, then styles
import { useState, useEffect } from 'react';
import { createClient } from '@supabase/supabase-js';

import GameSetup from './components/GameSetup';
import GameScoring from './components/GameScoring/index';

import './App.css';
```

## Project Standards
Per CLAUDE.md: "Group imports by external libraries, then local modules, then styles"

## Priority
üü° Important - Code consistency

## Acceptance Criteria
- [ ] Audit all files for import organization
- [ ] Standardize to: External ‚Üí Local ‚Üí Styles
- [ ] Add ESLint rule to enforce import order
- [ ] Update all existing files to follow standard
- [ ] Document import conventions in README

